import jsTPS_Transaction from "../common/jsTPS.js"

export default class EditSong_Transaction extends jsTPS_Transaction {
    constructor(initStore, index, title, artist, youtubeid) {
        super();
        this.store = initStore;
        this.index = index
        this.editedSong = {
            id: this.store.currentList.songs[index]._id,
            title: title,
            artist: artist,
            youTubeId: youtubeid
        }
    }

    doTransaction() {
        this.store.editSong(index);
    }

    undoTransaction() {
        this.store.editSong(index);
    }
}
